INSERT INTO `master_initiatives` (`MINT_ID`, `MINT_Lang`, `MINT_Title`, `MINT_Path`, `MINT_Status`, `MINT_Added_By`, `MINT_Added_Date`, `MINT_Updated_By`, `MINT_Updated_Date`) VALUES
(1, 2, 'जिल्ह्यातील पोलिस कर्मचार्‍यांकडून आरोग्याशी संबंधित सर्व माहिती संकलित करण्यासाठी धुळे जिल्हा पोलीस दलाने पुढाकार घेत निरामय - पोलीस पर्सन साठी  हे अँप्लिकेशन तयार करून घेण्यात आले आहे. सदर अँप्लिकेशन मध्ये पोलिस कर्मचारी त्यांच्या आजाराची माहिती नियमितपणे अद्ययावत करू शकतात, जेणेकरुन सर्व आरोग्याशी संबंधित इतिहास जतन केला जाईल.\r\nया साथीच्या परिस्थितीत, आवश्यक सेवा म्हणून पोलिस काम करत असतात आणि नियमितपणे जनतेशी संपर्कात असतात, म्हणूनच प्रत्येक पोलिस कर्मचाऱ्यांची आरोग्य माहिती रेकॉर्डवर असणे आवश्यक असते. या माहितीची नोंद ठेवण्यासाठी आणि त्यांचे विश्लेषण करण्यास निरामय - पोलीस पर्सन साठी  मदत करते.', 'uploads/initiatives/20200630201719.jpg', 1, 1, '2020-06-30 20:17:19', 1, '2020-07-01 12:38:10'),
(2, 2, 'भारत सरकारने संपूर्ण देशात कोरोन विषाणू महामारीच्या पार्श्वभूमीवर लॉक डाऊन ची घोषणा केलेली असताना, सर्वत्र संचारबंदी सुरु असल्याने गोरगरीब व रोजंदारीवर काम करणाऱ्या कुटुंबांची आर्थिक ओढाताण होत असल्यामुळे दैनंदिन उदरनिर्वाह करण्यासाठी अडचणींचा सामना करावा लागत आहे. या पार्श्वभूमीवर पोलीस अधीक्षक चिन्मय पंडित व अपर पोलीस अधीक्षक डॉ. राजू भुजबळ यांच्या हस्ते धुळे शहरातील गोरगरीब कुटुंबाना जीवनावश्यक वस्तूंचे वाटप करण्यात आले.', 'uploads/initiatives/20200701123920.jpg', 1, 1, '2020-07-01 12:39:20', 0, '0000-00-00 00:00:00'),
(3, 1, 'रक्तदान हेच सर्वश्रेष्ठ दान समजून पोलीस विभागातर्फे जिल्हा पोलीस मुख्यालय येथे आयोजित शिबिरात पोलीस अधिकारी, कर्मचाऱ्यांनी रक्तदान  केले.\r\nसामाजिक बांधिलकी जोपासत जिल्हा पोलीस अधीक्षक चिन्मय पंडित यांच्या संकल्पनेतून सामूहिक रक्तदान शिबिर घेण्यात आले असून, जमा झालेले रक्त जिल्हा सामान्य रुग्णालयात पाठविण्यात आले.', 'uploads/initiatives/20200701183113.jpg', 1, 1, '2020-07-01 18:31:13', 1, '2020-07-01 19:47:11'),
(4, 2, 'दिनांक ११/०७/२०२० रोजी धुळे पोलिसांतर्फे व एनडीएस ग्रुपच्या मदतीने पथनाट्यातून जनजागृती कार्यक्रम राबवण्यात आला. सदर जनजागृती कार्यक्रमातून कोविड-19 पासून बचाव करण्यासाठी सूचक मार्गदर्शन करण्यात आले. मास्क वापरा आणि सोशल डिस्टंसिंग पाळून कोरोना टाळा असा संदेश या कार्यक्रमातून देण्यात आला.', 'uploads/initiatives/20200712102015.jpg', 1, 1, '2020-07-12 10:20:15', 1, '2020-07-12 10:21:14'),
(5, 2, 'धुळे जिल्हा पोलीस येथे G- Hackbrain Info Pvt Ltd. कंपनीतर्फे सायबर सिक्युरिटी आणि फॉरेन्सिक इन्व्हेस्टीगेशन या विषयावर महिनाभर वेबिनारद्वारे कार्यशाळा आयोजित केली आहे. या कार्यशाळेत सायबर तज्ज्ञ श्री.  निखिल भागवत शिंगाडे (C.T.O, G-HBI) हे मार्गदर्शन करीत आहेत. या कार्यशाळेत १५० पेक्षा अधिक जिल्हा पोलीस दलातील पोलीस अधिकारी व कर्मचारी यांनी ऑनलाईन सहभाग नोंदवला. \r\nया कार्यशाळेसाठी मा. पोलीस अधीक्षक श्री चिन्मय पंडित, अपर पोलीस अधीक्षक डॉ. श्री राजू भुजबळ व G- Hackbrain Info Pvt Ltd.कंपनीचे व्यवस्थापक श्री गिरीष  बसरानी, यांनी पुढाकार घेतला व सायबर क्राईम पोलीस स्टेटशनचे कर्मचारी दिलीप वसावे आणि प्रितेश चौधरी यांनी कार्यशाळा पूर्ण करण्यासाठी हातभार लावला. ', 'uploads/initiatives/20200727111228.jpg', 1, 1, '2020-07-27 11:12:28', 0, '0000-00-00 00:00:00'),
(6, 2, 'धुळे पोलीस दल, धुळे मनपा व परिवहन महामंडळ, धुळे यांचे संयुक्त विद्यमाने कोरोना टाळण्यासाठी गणेश विसर्जनाचे दिवशी अनोखा उपक्रम. एसटी व पोलीस दलाच्या मालवाहू वाहनांतून होणार \'श्रींची\' वाहतूक. मुर्ती संकलनासाठी 37 ठिकाणे. सर्व गणेश भक्तांना या सेवेचा लाभ घ्यावा! गणपती बाप्पा मोरया!!', 'uploads/initiatives/20200831200132.jpg', 1, 1, '2020-08-31 20:01:32', 0, '0000-00-00 00:00:00'),
(7, 2, 'धुळे जिल्हा पोलीस अधीक्षक यांनी प्रत्यक्ष कृतीतून घालून दिला आदर्श. पोलीस अधीक्षक श्री. चिन्मय पंडित यांनी घरच्या गणेशाचे केले कृत्रिम तलावात विसर्जन. धुळे जिल्हा पोलिसांचे सर्व गणेश मंडळांना व नागरिकांना कोरोनापासून सुरक्षित राहण्यासाठी व पर्यावरणपूरक गणेशोत्सवासाठी धुळे जिल्हा पोलिसांचे आवाहन.!', 'uploads/initiatives/20201009185328.jpg', 1, 1, '2020-10-09 18:37:26', 1, '2020-10-09 18:53:28'),
(8, 2, 'धुळे जिल्हात कोरोनग्रस्त रुग्णांची संख्या वाढत असल्याने बंदोबस्तावर असलेले पोलीस अधिकारी व कर्मचारी हे कोरोनाग्रस्त झाल्याने त्यांना वेळेवर रुग्णालय बेड उपलब्ध होत नाही. सदर परिस्थितीचे गांभीर्य व अडचण लक्षात घेऊन मा. पोलीस अधीक्षक श्री. चिन्मय पंडित यांचे मार्गदर्शनाखाली पोलीस मुख्यालय, धुळे येथील नवीन राखीव पोलीस निरीक्षक कार्यालय येथील हॉलमध्ये पोलीस अधिकारी/कर्मचारी व त्यांचे कुटुंबीयांकरता तातपुते स्वरूपात उपचाराकरिता रुग्णालय बेड उपलब्ध होई पावतो ०८ बेड ऑक्सिजन सिलेंडरसह धुळे जिल्हा पोलीस कोव्हीड सेंटर तसेच दुसऱ्या ठिकाणी ३० बेडचे विलगीकरण कक्ष देखील तयार करण्यात आले. धुळे जिल्हा पोलीस कोव्हीड-१९ केअर सेंटरचे दिनांक ०५/१०/२०२० रोजी ११:०० वाजता मा. पोलीस अधीक्षक सो. श्री. चिन्मय पंडित यांच्या हस्ते उदघाटन करण्यात आले.', 'uploads/initiatives/20201009185305.jpg', 1, 1, '2020-10-09 18:48:20', 1, '2020-10-09 18:53:05'),
(9, 2, 'पोलिस अधीक्षक धुळे यांच्या हस्ते पोलिस अधीक्षक कार्यालय प्रांगणात ध्वजारोहण करण्यात आले. 75 व्या स्वातंत्र्यदिनाच्या सर्वांना हार्दिक शुभेच्छा. - चिन्मय पंडीत, पोलिस अधीक्षक धुळे.\r\n', 'uploads/initiatives/20210825194244.jpg', 1, 1, '2021-08-25 19:42:44', 1, '2021-08-25 19:43:58'),
(10, 1, '\"भारतीय स्वातंत्र्याचा अमृत महोत्सव उपक्रमांतर्गत महाराष्ट्र पोलीस दलातर्फे मुंबई ते दिल्ली (लाल किल्ला) सायकल मोहीम ”\r\n३ रा दिवस : चांदवड (नाशिक) ते शिरपूर (धुळे)\r\n रॅलीचा नागरिक नागरिकांनी तसेच गैरसरकारी संस्था यांनी सत्कार केला. \r\n', 'uploads/initiatives/20220805125533.jpeg', 1, 19, '2022-08-05 12:55:33', 0, '0000-00-00 00:00:00');
